import React from "react";

function View({ contents, setContents }) {
  const handleSelect = (username, deleteIdx) => {
    const select = tweets.filter((tweet, idx) => idx !== deleteIdx);
    setTweets(select);
  };
  return (
    <div className="View">
      <div className="View__item">
        {contents &&
          contents.map((el, idx) => (
            <li className="View__list" key={idx}>
              <div className="username">{el.username}</div>
              <div className="title">{el.title}</div>
              <div className="createAt">{el.createdAt}</div>
            </li>
          ))}
      </div>
    </div>
  );
}

export default View;
